import React from 'react';

const Footer = () => {
  return (
    <div>
      
     
      <footer ClassName="container">
    <p ClassName="float-end"><a href="#">Back to top</a></p>
    <p>© 2017–2021 Company, Inc. · <a href="#">Privacy</a> · <a href="#">Terms</a></p>
  </footer>
    

    </div>
  )
}
export default Footer;
